import Layout from "../components/_App/Layout";
import React from "react";
import Authentication from "./../components/Authentication/Authentication";


function App({ Component, pageProps }) {

  return (
    <Authentication>
      <Layout> 
        <Component {...pageProps} />
      </Layout>
    </Authentication>

  );

}

export default App;
